import React from "react";
import FulsoreLogo from "../../assets/fulsorelogo.jpeg";

function Navbar() {
  return (
    <div className="">
      {/* upper Navbar */}
      <div className="shadow-md bg-white dark:bg-gray-900">
        <div className="bg-green-300 py-2">
          <div className="flex justify-between items-center max-h-max">
            <a
              href="LoGo"
              className="font-bold text-2xl sm:text-3xl flex gap-1"
            >
              <img className="w-10 rounded-full" src={FulsoreLogo} alt="LOGO" />
              Fulsore
            </a>
          </div>
          {/* search bar */}
          <div>
            <div>
              <input
                type="text"
                placeholder="search"
                className="w-[200px] sm:w-[200px] group-hover:w-[300px] transition-all duration-300 rounded-full px-2px py-1 focus:outline-none focus:border-1 focus:border-blue-400"
              />
            </div>
          </div>
        </div>
      </div>
      {/* lower navbar */}
      <div></div>
    </div>
  );
}

export default Navbar;
